import React ,{useState} from 'react';
import "./Registeration.css"
import {useHistory} from 'react-router-dom'

import { BrowserRouter, Route, Link } from "react-router-dom";
function ModalsNavPage(props) {
  

/*componentDidMount(){
    fetch("https://api-nodejs-todolist.herokuapp.com/user/register",{
        method:"POST",
 
    headers:{"Content-Type": "application/json",
"Accept":"application/json"

}

    }) .then(res => res.json())
    .then(res => {
     
       console.log(res)
    })
    
     .catch(err => { console.log(err); 
     });
     
   }*/
   const [name, setName] = useState("")
const [password,setPassword ] = useState("")
const [email,setEmail ] = useState("")
const [age,setAge ] = useState("")
const history =useHistory();
   async function signUp(){
       let item={name,password,email,age}
    console.warn(item)
    let result =await fetch("https://api-nodejs-todolist.herokuapp.com/user/register",{

    method:'POST',
    body:JSON.stringify(item),
    headers:{"Content-Type": "application/json",
"Accept":"application/json"
},
    })

    result=await result.json()
 localStorage.setItem("user",JSON.stringify(result))
 history.push('/advanced')
          }

 
        return (
            <div>
                 <div>
            <form className="form-control">
            <div>
                <label>Name</label>
<input type="text" className="form-control" placeholder="name" onChange={(e)=>setName(e.target.value)}/>
</div>
<div>
<label>Email</label>
<input type="email" className="form-control" placeholder="Email"  onChange={(e)=>setEmail(e.target.value)}/></div>
<div>
<label>Password</label>
<input type="password" className="form-control" placeholder="password" onChange={(e)=>setPassword(e.target.value)}/></div>
<div>
<label>age</label>
<input type="number" className="form-control" placeholder="age" onChange={(e)=>setAge(e.target.value)}/></div>
<button  onClick={signUp}>
Sign Up 
</button>
            </form>
        </div> 
            </div>
        )
    
        }




export default ModalsNavPage
